import React from "react";


const GenreList = () => {

     const navigate = useNavigate();

    const handleNavigate = (path) => {
        navigate(path);
    };
    return (
        <div >
            <div >
                <h1 >Book Library</h1>
                
            </div>

            <div>
                <div >
                    <div  onClick={() => handleNavigate("/sci-fi")}>
                        


                        <div >Science-fiction</div>
                    </div>
                    <div  onClick={() => handleNavigate("/horror")}>
                        



                        <div >Horror</div>
                    </div>
                </div>
                <div >
                    <div  onClick={() => handleNavigate("/mystery")}>
                        



                        <div >Mystery</div>
                    </div>
                    <div  onClick={() => handleNavigate("/adventure")}>
                        
                        


                        <div >Adventure</div>
                    </div>
                    
                </div>
            </div>
        </div>
    );
};

export default GenreList;
